            amount : amount
          }
        }

      //const url = `http://localhost:9000/publicAPI`
      axios.request(options)
      .then(response => {setPublic(response)})
      .catch(error => console.error(error))
      }
      );
      return (
        <div>
            {papi ? <pre>{JSON.stringify(papi, null, 2)}</pre> : "Loading..."}
